import axios from "axios";

export const fetchPendingRequest = async (u) => {
    await axios
      .get('http://localhost:5000/api/leave/pendingrequest', {
        params: { userId: user.id }
      })
      .then((response) => {
        return response.data.leaveRequestes;
      })
      .catch((err) => {
        console.log(err);
      });
}
